@networkrail *coughs* your network isn't longer today; rails don't expand when heated up, they are fixed at each end &amp; by sleepers &amp; ballast, &amp; so go "into compression". Like when you pump a bike tyre up but it doesnt get any bigger.

Too much &amp; you get a buckle.

Great thread otherwise tho!

